// Generated file - do not change manually!
/**
 * Defines which separator style will be applied for the list items.
 */
export var ListSeparators;
(function (ListSeparators) {
    /**
     * Separators between the items including the last and the first one.
     */
    ListSeparators["All"] = "All";
    /**
     * Separators between the items. <b>Note:</b> This enumeration depends on the theme.
     */
    ListSeparators["Inner"] = "Inner";
    /**
     * No item separators.
     */
    ListSeparators["None"] = "None";
})(ListSeparators || (ListSeparators = {}));
